pragma solidity >=0.4.21 <0.7.0;
pragma experimental ABIEncoderV2;

import "./UserManager.sol";
import "./Ticket.sol";

contract TicketManager {
    address _admin;
    address _ticketDataAddr;
    UserManager private _userManager;
    mapping(string=>address) _ticketAddrs;

    event TicketIssue(address indexed companyAddr, address indexed ticketAddr, string ticketId);
    event TicketMint(string ticketId, string[] cTicketId, address indexed userAddr);
    event TicketTransfer(string[] cTicketId, address indexed fromUser, address indexed toUser, uint transferPrice);
    event TicketCheck(string cTicketId, address indexed scenicAddr, address indexed userAddr);
    
    constructor(address userManagerAddr, address ticketDataAddr) public {
        _admin = msg.sender;
        _ticketDataAddr = ticketDataAddr;
        _userManager = UserManager(userManagerAddr);
    }

    // issued ticket
    function issueTicket(string scenicName, address scenicAddr, string ticketId, uint price, uint total, uint64 sDate, uint64 eDate, string memory comment) public {
        bool _isIssuer = _userManager._checkUserExist(1, msg.sender);
        require(_isIssuer,"only issue company can issue Ticket");
        require((_ticketAddrs[ticketId] == address(0)), "this Ticket already issued");
        string memory _issueCompanyName;
        (_issueCompanyName,) = _userManager.getIssueCoInfo(msg.sender);
        Ticket ticket = new Ticket(_issueCompanyName, scenicName, scenicAddr, ticketId, price, total, sDate, eDate, comment, _ticketDataAddr);
        _userManager._issueTicket(msg.sender, ticketId);
        _ticketAddrs[ticketId] = address(ticket);
        emit TicketIssue(msg.sender,address(ticket),ticketId);
    }

    // update ticket
    function updateTicket(string scenicName, address scenicAddr, string ticketId, uint price, uint total, uint64 sDate, uint64 eDate, string memory comment) public {
        bool _isIssuer = _userManager._checkUserExist(1, msg.sender);
        require(_isIssuer,"only issue company can update Ticket");
        require((_ticketAddrs[ticketId] != address(0)), "this Ticket is not issued");
        string memory _issueCompanyName;
        (_issueCompanyName,) = _userManager.getIssueCoInfo(msg.sender);
        Ticket ticket = Ticket(_ticketAddrs[ticketId]);
        ticket._updateTicket(_issueCompanyName, scenicName, scenicAddr, price, total, sDate, eDate, comment);
        emit TicketIssue(msg.sender,address(ticket),ticketId);
    }


    // mint ticket for user
    function mintTicket(string ticketId, address userAddr, string[] cTicketIds) public {
        require((_ticketAddrs[ticketId] != address(0)), "this Ticket not issued");
        address _ticketAddr = _ticketAddrs[ticketId];
        Ticket _ticket = Ticket(_ticketAddr);
        _ticket._mintTicket(userAddr, cTicketIds);
        _userManager._mintTicket(userAddr,ticketId,cTicketIds);
        emit TicketMint(ticketId,cTicketIds,userAddr);
    }
    
    function transferTicket(address toUser, string ticketId, string[] cTicketIds, uint transferPrice) public {
        require((_ticketAddrs[ticketId] != address(0)), "this Ticket not issued");
        address _ticketAddr = _ticketAddrs[ticketId];
        Ticket _ticket = Ticket(_ticketAddr);
        _ticket._transferTicket(toUser,cTicketIds,transferPrice);
    }

    function listTicket(string ticketId, string[] cTicketIds, uint transferPrice) public {
        require((_ticketAddrs[ticketId] != address(0)), "this Ticket not issued");
        address _ticketAddr = _ticketAddrs[ticketId];
        Ticket _ticket = Ticket(_ticketAddr);
        _ticket._listTicket(cTicketIds,transferPrice);
    }
    
    function acceptTicket(string ticketId, string[] cTicketIds, uint state) public {
        require((_ticketAddrs[ticketId] != address(0)), "this Ticket not issued");
        address _ticketAddr = _ticketAddrs[ticketId];
        Ticket _ticket = Ticket(_ticketAddr);
        address _toUser = msg.sender;
        address _fromUser;
        (_fromUser,) =  _ticket._getcTicketInfo(cTicketIds[0]);
        (,uint256 transferPrice,) =  _ticket._getcTicketTransferInfo(cTicketIds[0]);
        _ticket._acceptTicket(cTicketIds,state);
        if(state == 0){
            _userManager._acceptTicket(_fromUser,_toUser,cTicketIds,transferPrice);
            emit TicketTransfer(cTicketIds,_fromUser,_toUser,transferPrice);
        }
    }

    function buyTicketFromMarket(string ticketId, string[] cTicketIds) public {
        require((_ticketAddrs[ticketId] != address(0)), "this Ticket not issued");
        address _ticketAddr = _ticketAddrs[ticketId];
        Ticket _ticket = Ticket(_ticketAddr);
        address _toUser = msg.sender;
        address _fromUser;
        (_fromUser,) =  _ticket._getcTicketInfo(cTicketIds[0]);
        (,uint256 transferPrice,) =  _ticket._getcTicketTransferInfo(cTicketIds[0]);
        _ticket._buyTicketFromMarket(cTicketIds);
        _userManager._acceptTicket(_fromUser,_toUser,cTicketIds,transferPrice);
        emit TicketTransfer(cTicketIds,_fromUser,_toUser,transferPrice);
    }


    function cancelSoldTicket(string ticketId, string[] cTicketIds) public {
        require((_ticketAddrs[ticketId] != address(0)), "this Ticket not issued");
        address _ticketAddr = _ticketAddrs[ticketId];
        Ticket _ticket = Ticket(_ticketAddr);
        _ticket._cancelSoldTicket(cTicketIds);
    }

    
    function checkcTicket(address userAddr, string ticketId, string cTicketId) public {
        require((_ticketAddrs[ticketId] != address(0)), "this Ticket not issued");
        address _ticketAddr = _ticketAddrs[ticketId];
        Ticket _ticket = Ticket(_ticketAddr);
        _ticket._checkcTicket(userAddr,cTicketId);
        _userManager._checkcTicket(cTicketId, userAddr);
        emit TicketCheck(cTicketId,msg.sender,userAddr);
    }
    
    // get ticket info
    function getTicketInfo(string ticketId) public view returns(string memory issuer, address scenicAddr, uint price, uint total, uint issued, uint64 sDate, uint64 eDate) {
        address ticketAddr = _ticketAddrs[ticketId];
        Ticket _ticket = Ticket(ticketAddr);
        (issuer,scenicAddr,price,total,issued,sDate,eDate) = _ticket._getTicketInfo();
    }
    
    // get child ticket info
    function getcTicketInfo(string ticketId, string cTicketId) public view returns(address holder, uint state, address toUser, uint transferPrice, uint transferState) {
        address ticketAddr = _ticketAddrs[ticketId];
        Ticket _ticket = Ticket(ticketAddr);
        (holder,state) = _ticket._getcTicketInfo(cTicketId);
        (toUser,transferPrice,transferState) = _ticket._getcTicketTransferInfo(cTicketId);
    }

    // get ticket address
    function getTicketAddr(string ticketId) public view returns(address ticketAddr) {
        ticketAddr = _ticketAddrs[ticketId];
    }
}
